import React from 'react'
import Animal from './Animal'


export default function AnimalList({animals,addLikes,setAnimalLikes,}) {
    const allanimals =animals.map(animal => (
        <Animal 
           animal={animal}
           key={animal.id}
           className="animal-list"
           addLikes={addLikes}
           setAnimalLikes={animalLikes}
        />
    ))
  return (
   <div className="animal-list">{allanimals}</div>
  )
}
